import logo from './logo.svg';
import './App.css';
import Navigation from 'components/navigation/Navigation.js';
import { BrowserRouter as Router } from 'react-router-dom';
import Choreograph from './choreograph/Choreograph.js';

function App() {
  return (
    <div>
      <Router>
          <Navigation />
          <Choreograph />
      </Router>
    </div>
  );
}

export default App;
